class Vocab():
  def __init__(self, token_list):
    self.rev_vocab = token_list 
    self.vocab = {token:i for i, token in enumerate(token_list)}

  def token2id(self, token):
    return self.vocab[token]

  def id2token(self, _id):
    return self.rev_vocab[_id]

  @property
  def size(self):
    return len(self.rev_vocab)

