def state2tensor(state):
  if isinstance(state, dict):
    turn = state['turn']
    timer = state['timer']
    kitchen = state['kitchen']
    items = state['items']
    orders = state['orders']
    player = state['player']
    partner = state['partner']
    action= state['action']
    rewards = state['rewards']
  else:
    turn, timer, kitchen, items, orders, player, partner = state
    # Only available from similator.
    action = None
    rewards = None
  if not items:
    items = []
  # Kitchen and Items (= board) state
  max_x = len(kitchen[0])
  max_y = len(kitchen)

  board_state = np.zeros([max_y, max_x, board_vocab.size], dtype=np.int32)
  for y, kitchen_line in enumerate(kitchen):
    for x, tile in enumerate(kitchen_line):
      tile_id = board_vocab.token2id(tile)
      board_state[y][x][tile_id] += 1

  for x, y, item_list in items:
    for item in item_list:
      item_id = board_vocab.token2id(item)
      board_state[y][x][item_id] += 1

  order_state = np.zeros([3, item_vocab.size], dtype=np.int32)
  awards = []
  for i, (items, award) in enumerate(orders):
    awards.append(award)
    for item in items:
      item_id = item_vocab.token2id(item)
      order_state[i][item_id] += 1

  timer_state = np.zeros([11])
  timer_state[timer] = 1
  player_x, player_y, _player_items = player
  _player_items = _player_items if _player_items else []
  player_coord = (player_x, player_y)
  player_items = np.zeros([item_vocab.size])
  for item in _player_items:
    item_id = item_vocab.token2id(item)
    player_items[item_id] += 1
    board_state[player_y][player_x][item_id] = 1

  partner_x, partner_y, _partner_items = partner
  _partner_items = _partner_items if _partner_items else []
  partner_coord = (partner_x, partner_y)
  partner_items = np.zeros([item_vocab.size])
  for item in _partner_items:
    item_id = item_vocab.token2id(item)
    partner_items[item_id] += 1
    board_state[partner_y][partner_x][item_id] = 1

  state = {
    'turn': np.array(turn),
    'board': board_state,
    'orders': order_state,
    'order_awards': np.array(awards),
    'timer': np.array(timer),
    'player_coord': np.array(player_coord),
    'player_items': player_items,
    'partner_coord': np.array(partner_coord),
    'partner_items': partner_items,
    'actions': action_vocab.token2id(action) if action else None,
    'rewards': np.array(rewards) if rewards is not None else None
  }
  return state


