class NPCNNBased:
  def __init__(self, config):
    self.config = config
    self.params = self.read_params(config) if config.model_root_path else PARAMS

  def read_params(self, config):
    _parameters_dir = config.model_root_path + '/parameters'
    if hasattr(config, 'epoch') and config.epoch:
      parameters_dir = _parameters_dir + '/%03d' % config.epoch
    else:
      parameters_dir = _parameters_dir + '/' + os.listdir(_parameters_dir)[-1]
    params = dotDict()
    for f in os.listdir(parameters_dir):
      params[f] = np.loadtxt(open(parameters_dir + '/' + f))
    return params

  def cnn_2d(self, inputs, filter_w, filter_b, strides=[0, 1, 1, 0], 
             padding='SAME', scope=None, dtype=np.float16,
             activation=np.tanh):

    # inputs: [height, width, in_channels]
    if padding == 'SAME':
      inputs = np.pad(inputs, [(1,1), (1,1), (0,0)], 'constant')
    elif padding == 'VALID':
      pass
    _, x_stride, y_stride, _ = strides
    ih, iw, in_channels = inputs.shape
    fh, fw, in_channels, out_channels = filter_w.shape

    out_h = (ih - fh + 1) // y_stride
    out_w = (iw - fw + 1) // x_stride
    outputs = np.zeros([out_h, out_w, out_channels], dtype=np.float16)
    for i in range(out_h):
      for j in range(out_w):
        chunk = inputs[i*y_stride:i*y_stride+fh, 
                       j*x_stride:j*x_stride+fw, :]
        outputs[i][j] = np.matmul(
          np.reshape(chunk, [-1]),
          np.reshape(filter_w, [-1, out_channels]))  + filter_b
    outputs = activation(outputs)
    return outputs

  def getInvalidActions(self, game):
    invalid_actions = []
    for tile in flatten(game.kitchen.tiles):
      if tile.name in [FLOOR_CELL, PLAYER, PARTNER]:
        invalid_actions.append('USE %d %d' % (tile.x, tile.y))
    return invalid_actions

  def getAction(self, game):
    invalid_actions = self.getInvalidActions(game)

    if hasattr(self.config, 'epsilon') and np.random.rand() < self.config.epsilon:
      actions = [act for act in action_vocab.rev_vocab if act not in invalid_actions]
      action = np.random.choice(actions)
    else:
      values = self.inference(state2tensor(game.state))
      for act in invalid_actions:
        values[action_vocab.token2id(act)] = -INF
      action_id = np.argmax(values)
      action = action_vocab.id2token(action_id)
    return action

  def inference(self, inp):
    return self.calc_q_values(
      self.params, 
      inp['board'], inp['orders'], inp['order_awards'] * REWARD_SCALE)

  def calc_q_values(self, params, board_ph, orders_ph, order_awards_ph):
    board_ph = board_ph.astype(np.float16)

    filter_w = np.reshape(
      params.L1_CNN_w, 
      [self.config.filter_h, self.config.filter_w, self.config.emb_size, -1])
    filter_b = params.L1_CNN_b
    
    wait_emb = params.embeddings_action[0]
    move_emb = params.embeddings_action[1]
    use_emb  = params.embeddings_action[2]

    assert len(board_ph.shape) == 3
    y, x, v = board_ph.shape

    # Encode Board
    emb_size = params.embeddings_board.shape[-1]
    emb_inp = np.reshape(np.matmul(np.reshape(board_ph, [y*x, v]), 
                                   params.embeddings_board), 
                         [y, x, emb_size])

    activation = relu
    local_board_repls = self.cnn_2d(emb_inp, filter_w, filter_b,
                                    padding='SAME',
                                    activation=activation)
    global_board_repls = self.cnn_2d(local_board_repls, filter_w, filter_b,
                                    padding='VALID',
                                    activation=activation)
    global_board_repls = self.cnn_2d(global_board_repls, filter_w, filter_b,
                                    padding='VALID',
                                    activation=activation)

    
    global_board_repls = np.average(local_board_repls, axis=(0,1))
    hidden_state = global_board_repls

    # Encode Orders
    order_repls = np.matmul(orders_ph, params.embeddings_board[:item_vocab.size])
    order_awards = np.expand_dims(order_awards_ph, -1)
    order_repls = np.concatenate([order_repls, order_awards], axis=-1)

    attn_params = (
      params.encode_order_attention_ref_ffnn_w,
      params.encode_order_attention_ref_ffnn_b,
      params.encode_order_attention_cand_ffnn_w,
      params.encode_order_attention_cand_ffnn_b)
    order_attn_weights = attention(attn_params, hidden_state, order_repls)
    order_attn_weights = np.expand_dims(order_attn_weights, -1)
    order_repls = order_attn_weights * order_repls
    order_repls = np.sum(order_repls, axis=-2)

    def _expand(state):
      state = np.expand_dims(state, axis=-2)
      state = np.expand_dims(state, axis=-2)
      return state
    # Combine global board repls, local_local_board_repls, and action_embs.
    state_for_wait = wait_emb
    state_for_move = _expand(hidden_state * move_emb)
    state_for_use = _expand(hidden_state * use_emb)
    wait_action = np.expand_dims(state_for_wait * hidden_state, axis=-2)
    move_action = np.reshape(state_for_move * local_board_repls, [Y*X, shape(hidden_state, -1)])
    use_action = np.reshape(state_for_use * local_board_repls, [Y*X, shape(hidden_state, -1)])

    action_repls = np.concatenate([wait_action, move_action, use_action], axis=-2)

    q_values = np.sum(action_repls, axis=-1)
    return q_values

def play(logic):
  # ALL CUSTOMERS INPUT: to ignore until bronze
  num_all_customers = int(input())

  order_schedules = []
  for i in range(num_all_customers):
    customer_item, customer_award = input().split()
    customer_award = int(customer_award)
    order_schedules.append(Order(customer_item, customer_award))

  # KITCHEN INPUT
  tiles = []
  for y in range(7):
    kitchen_line = [Tile(x, y, tileChar) for x, tileChar in enumerate(input())]
    tiles.append(kitchen_line)
  kitchen = Kitchen(tiles)
  game = Game(kitchen, order_schedules)

  # game loop
  while True:
    turns_remaining = int(input())

    # PLAYERS INPUT
    player = Player(*input().split())
    partner = Player(*(input().split()))

    # Gather and update table information
    num_tables_with_items = int(input())  # the number of tables in the kitchen that currently hold an item

    tables = []
    for i in range(num_tables_with_items):
      table_x, table_y, item = input().split()
      table_x = int(table_x)
      table_y = int(table_y)
      tables.append((table_x, table_y, item))

    oven_contents, oven_timer = input().split()
    oven_timer = int(oven_timer)
    oven = (oven_contents, oven_timer)

    num_customers = int(input())  # the number of customers currently waiting for food
    orders = [Order(*(input().split())) for i in range(num_customers)]

    game.update(turns_remaining, player, partner, tables, oven, orders)
    
    # GAME LOGIC
    action = logic.getAction(game)
    game.log_state(action, args.log_as_json)
    # table以外を使おうとすると失敗するらしい
    print(action)
    

def get_parser():
  desc = ""
  parser = argparse.ArgumentParser(description=desc)
  # parser.add_argument('mode', type=str, help ='')
  parser.add_argument('-mrp', '--model_root_path', default=None, type=str)
  parser.add_argument('-e', '--epoch', default=None, type=int)
  parser.add_argument('--filter_h', default=3, type=int)
  parser.add_argument('--filter_w', default=3, type=int)
  parser.add_argument('--emb_size', default=30, type=int)
  parser.add_argument('-eps', '--epsilon', default=0.0, type=float)
  parser.add_argument('--log_as_json',action='store_true',
                      default=False)
  return parser


def main(args):
  logic = NPCNNBased(args)
  play(logic)

if __name__ == "__main__":
  import argparse
  parser = get_parser()
  args = parser.parse_args()
  main(args)





